script: |
  super -f text -I q1881.spq | sort > q1881.out

inputs:
  - name: q1881.spq
    data: |
      SELECT DISTINCT col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - ( + - col1 ) * - col2 * - col0 + + + 33 - + col2 BETWEEN 68 AND col2;
  - name: tab1

outputs:
  - name: q1881.out
    data: |
      14
      47
      5
